window.bookSummaryJSON = "<p><b>There's nothing more terrifying than a pissed off woman - except the Devil. I'm both.</b><br> <br> The angels warned me that I should fear their wrath. Theirs? Please! They have no idea who they're dealing with. Not that I really do either, but I'm quickly figuring out that I'm a whole lot more than just an artist.<br> <br> Designed by God, created by people, and made possible by the atrocities of the supposed \"good guys,\" I'm here to set things right. To punish those who deserve it, and the archangel Michael is at the top of my list. That guy can't help but piss me off.<br> <br> I just have a few things to deal with first. You know, like the mess I made of Hell. And no, I don't feel bad about that. They completely deserved it. They also learned their lesson.<br> <br> The angels honestly think their attitude problem should scare me? Me! I'm God's <i>equal</i>. I'm supposed to be the \"bad guy\", after all. I'm here to bring down Heaven and unleash chaos on the world.<br> <br> The Wrath of Angels?<br> No, there's something much, much worse:<br> A woman on a mission.</p> <p>The Wrath of Angels<i> is a full-length novel with no cliffhanger ending. This series includes multiple love interests, with some M/M themes. Graphic language, adult situations, and potentially triggering violence that are suitable for a mature audience are included.</i></p> <p><b><i>Be warned:</i></b><i> Everything you thought you knew about the world, religion, and death will be pulled apart, twisted around, and put back together in ways you will not expect.</i></p>"; 
